import React from 'react';
import TodoListItem from './TodoListItem';

const TodoList = ({todos}) => {
	return (
		<div>
			{
				todos.map((item) => {
					return (
						<ul>
							<li>
								<TodoListItem 
									label={item.label}
									important={item.important}
								/>
							</li>
						</ul>
					)
				})
			}
		</div>
	)
}

export default TodoList;
